import ".././tailwindoutput.css";

function CreateBookForm() {
    return (
        <div>
            <h1>Add a new book</h1>
            <form class="bg">
                <div class="bg-white rounded shadow-lg w-[400px] h-[400px] p-6">
                    <label class="font-bold block">Book's title: </label>
                    <input type="text" />
                </div>

                <button type="submit">Submit</button>
            </form>
        </div>
    );
}

export default CreateBookForm;
